import React, { useEffect, useState } from "react";
import { Button, SideBar } from "./component/Component";
import { useNavigate } from "react-router-dom";

function Dashboard() {
  const navigate = useNavigate();
  const [nav, setNav] = useState(false);

  const toggleNav = () => setNav(!nav);

  useEffect(() => {
    if (localStorage.getItem("isLogin") !== "true") {
      navigate("/");
    }
  }, [navigate]);

  return (
    <div className="w-full h-screen flex bg-gray-300">
      {/* Sidebar */}
      <div className="w-1/6 min-w-[200px] h-full">
        <SideBar nav={nav} />
      </div>
      {/* Main Content */}
      <div className="flex-1 flex flex-col h-full">
        {/* Header */}
        <div className="flex items-center justify-between px-8 py-6 border-b border-gray-200 bg-white">
          <Button
            className="bg-blue-500 text-white px-4 py-2 rounded hover:bg-blue-600"
            onClick={toggleNav}
          >
            <i className="bi bi-list"></i>
          </Button>
          <h1 className="text-3xl font-bold text-center flex-1">Dashboard</h1>
          <div className="w-12" /> {/* Spacer agar judul tetap di tengah */}
        </div>
        {/* Content */}
        <div className="flex-1 flex flex-col justify-center items-center">
          <p className="text-lg mb-4">
            Welcome,{" "}
            <span className="font-semibold">
              {localStorage.getItem("username")}
            </span>
          </p>
        </div>
      </div>
    </div>
  );
}

export default Dashboard;
